import React from 'react'
import { BrowserRouter } from 'react-router'
import './Blog.css'
import BlogPosts from './BlogPosts/BlogPosts'

export default function Blog(props) {
    return (
        <Router>
            <Route path="/posts/1">
                <BlogPosts/>
            </Route>
        </Router>
    )
}
